            $1M+
          </div>
        </div>

        <div className="pricing-details">
          {activePrice === 'below250k' && (
            <>
              <h3>For asking prices below $250k</h3>
              <p>8% closing fee when you sell</p>
              <p>Plus $25/mo to list</p>
